import React, { useRef, useState } from 'react';

import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';

import styles from './registerForm.module.css';

function RegisterForm(props) {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [userName, setUserName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [owners, setOwners] = useState('');

    const inputChange = (e) => {
        switch(e.target.name) {
            case "firstName":
                setFirstName(e.target.value);
                break;
            case "lastName":
                setLastName(e.target.value);
                break;
            case "userName":
                setUserName(formatPhoneNumber(e.target.value));
                break;
            case "email":
                setEmail(e.target.value);
                break;
            case "password":
                setPassword(e.target.value);
                break;
            case "confirmPassword":
                setConfirmPassword(e.target.value);
                break;
            case "owners":
                setOwners(e.target.value);
                break;
            default:
                break;
        }
    }

    const handleFormSubmit = () => {
        console.log('Register');
    }

    return (
        <Container>
        <Form 
            onSubmit={handleFormSubmit}
        >
            <Row className="justify-content-center mt-2">
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>First Name</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="John" 
                            name='firstName'
                            onChange={inputChange}
                        />
                    </Form.Group>
                </Col>
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>Last Name</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="Smith" 
                            name='lastName'
                            onChange={inputChange}
                        />
                    </Form.Group>
                </Col>
            </Row>
            <Row className="justify-content-center mt-2">
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>Username</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="JohnSmith123"
                            name='userName'
                            onChange={inputChange}
                        />
                    </Form.Group>
                </Col>
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>E-Mail</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="John.Smith@test.com" 
                            name='email'
                            onChange={inputChange} 
                        />
                    </Form.Group>
                </Col>
            </Row>
            <Row className="justify-content-center mt-2">
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>Password</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="Password" 
                            name='password'
                            onChange={inputChange}
                        />
                    </Form.Group>
                </Col>
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>Confirm Password</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="Password" 
                            name='confirmPassword'
                            onChange={inputChange}
                        />
                    </Form.Group>
                </Col>
            </Row>
            <Row className="justify-content-center mt-2">
                <Col xs={10} md={4}>
                    <Form.Group>
                        <Form.Label>Owners</Form.Label>
                        <Form.Control
                            type="text" 
                            placeholder="Owners Name" 
                            name='owners'
                            onChange={inputChange}
                        />
                    </Form.Group>
                </Col>
                <Col xs={10} md={4}>
                    <div></div>
                </Col>
            </Row>
            <Row className="justify-content-center mt-2">
                    <Col xs={10} md={4}>
                        <Button className={styles.registerAccount} type="submit">Register Account</Button>
                        <Button className={styles.loginButton} onClick={props.toggleLogin}>Login</Button>
                    </Col>
                    <Col xs={10} md={4}>
                        <div></div>
                    </Col>
                </Row>
        </Form>
    </Container>
    )
}

export default RegisterForm;
